import { useState } from "react";
import { FiHome, FiUsers, FiAlertTriangle, FiSettings } from "react-icons/fi";

const Dashboard = () => {
  const [activeTab, setActiveTab] = useState("Home");

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <div className="w-64 bg-gray-900 text-white flex flex-col">
        <div className="p-5 text-2xl font-bold border-b border-gray-700">Honesta</div>
        <nav className="flex-1 p-5">
          <SidebarItem icon={<FiHome />} text="Home" active={activeTab} setActive={setActiveTab} />
          <SidebarItem icon={<FiUsers />} text="Users" active={activeTab} setActive={setActiveTab} />
          <SidebarItem icon={<FiAlertTriangle />} text="Alerts" active={activeTab} setActive={setActiveTab} />
          <SidebarItem icon={<FiSettings />} text="Settings" active={activeTab} setActive={setActiveTab} />
        </nav>
      </div>

      {/* Main Dashboard */}
      <div className="flex-1 p-6">
        <h1 className="text-3xl font-semibold text-gray-800">{activeTab}</h1>
        <div className="mt-6">
          {activeTab === "Home" && <DashboardHome />}
          {activeTab === "Users" && <Users />}
          {activeTab === "Alerts" && <Alerts />}
          {activeTab === "Settings" && <Settings />}
        </div>
      </div>
    </div>
  );
};

// Sidebar Item Component
const SidebarItem = ({ icon, text, active, setActive }) => (
  <button
    onClick={() => setActive(text)}
    className={`flex items-center p-3 rounded-md w-full text-left ${
      active === text ? "bg-gray-700" : "hover:bg-gray-800"
    }`}
  >
    <span className="text-lg mr-3">{icon}</span>
    {text}
  </button>
);

// Dashboard Home Content
const DashboardHome = () => (
  <div className="grid grid-cols-3 gap-6">
    <DashboardCard title="Active Users" count="34" color="blue" />
    <DashboardCard title="Risk Alerts" count="12" color="red" />
    <DashboardCard title="Total Exams" count="98" color="green" />
  </div>
);

// Dashboard Stats Card
const DashboardCard = ({ title, count, color }) => (
  <div className={`p-6 rounded-lg shadow-md bg-${color}-100 text-${color}-900`}>
    <h2 className="text-lg font-semibold">{title}</h2>
    <p className="text-3xl font-bold">{count}</p>
  </div>
);

// Users Section
const Users = () => (
  <div className="bg-white p-6 shadow-md rounded-lg">
    <h2 className="text-xl font-semibold mb-4">Registered Users</h2>
    <ul>
      <li className="border-b p-2">John Doe - johndoe@gmail.com</li>
      <li className="border-b p-2">Jane Smith - janesmith@gmail.com</li>
    </ul>
  </div>
);

// Alerts Section
const Alerts = () => (
  <div className="bg-white p-6 shadow-md rounded-lg">
    <h2 className="text-xl font-semibold mb-4">Recent Risk Alerts</h2>
    <p>No recent alerts.</p>
  </div>
);

// Settings Section
const Settings = () => (
  <div className="bg-white p-6 shadow-md rounded-lg">
    <h2 className="text-xl font-semibold mb-4">Admin Settings</h2>
    <p>Configure system settings here.</p>
  </div>
);

export default Dashboard;
